import React from 'react';
import { PageContainer } from '../global-page-styles/global-page-styles';

import { AboutDescription } from './about.styles';


const AboutPage = (props) =>{

  return (
    <PageContainer>
    <h1>About</h1>
    <AboutDescription><strong>Description and Mission Statement:</strong><br/>Dale Street is a Mixing, Mastering, & Production Studio. Whether getting a track or album ready for release to a myriad of different formats and streaming playback; or working on a new production, I'd love to see how I can help.</AboutDescription>

    <AboutDescription><strong>About:</strong><br/>As a longtime DJ and musician, Marcus Dale Norwood, aka DJ Definition (hiphop) and M.D. Norwood (garage rock & soul), started Dale Street Studio to represent his expanding studio and 20+ years of experience in audio.
    </AboutDescription>
    <AboutDescription>Let me know how you'd like me to help on your project. Contact me today to get rates and book my services.</AboutDescription>
    <button onClick={() => props.history.push('/')}>Home</button>  
    </PageContainer>
  )
};




export default React.memo(AboutPage);
